import React, { useState } from "react";

const Square = ({ value, onClick }) => {   // Using an Arrow Function to create the Square element as a functional component...
    return (
        <button className="square" onClick={onClick}>
            {value}
        </button>
    );
}

function renderSquare(i) {
    return
    <Square
        value={squares[i]}
        onClick={() => {
            const nextSquares = squares.slice();
            nextSquares[i] = 'X';
            setSquares(nextSquares);
        }}
    />;
}

export default Square;
